    public function airlineReportMonthly()
    {
        try {
            $mpdf = new \Mpdf\Mpdf([
                'Siyam Rupali ANSI' => 'bangla', // Ensure this is the correct font family name or font file path
                'mode' => 'utf-8',
                'format' => 'A4',
                'orientation' => 'L',
            ]);
            $mpdf->debug = true;
    
            // Validate input
            $validatedData = request()->validate([
                'year' => 'nullable',
                'month' => 'nullable'
            ]);
    
            // Set date
            if (isset($validatedData['year']) && isset($validatedData['month'])) {
                $date = Carbon::createFromDate($validatedData['year'], $validatedData['month'], 1)->toImmutable();
            } else {
                $date = Carbon::now()->firstOfMonth()->toImmutable();
            }
    
            // Generate HTML for the report
            $html = $this->getHtml($this->getAirlineData($date), $date, 'english');
    
            // Write HTML to PDF
            $mpdf->WriteHTML($html);
    
            // Output PDF to the browser
            $mpdf->Output('Monthly-Airline-Report-' . $date->monthName . '-' . $date->year . '.pdf', 'I');
        } catch (\Exception $e) {
            // Handle exceptions
            error_log($e->getMessage());
            echo "An error occurred while generating the PDF.";
        }
        exit;
    }
    

    private function getAirlineData($date)
    {
        $airlines = Airline::all();
        foreach ($airlines as $airline) {
            //get all tickets by airlines and date
            $airline->setAccountReportData($date);
        }
        return $airlines;
    }


    private function tableRow($airlines)
