                            <td>' . $item->total_airline_profit . '</td>
                            <td>' . $item->total_bonus . '</td>
                            <td>' . $item->currentBalance . '</td>
                            <td>' . ($item->total_ticket_price ) . '</td>
                            <td>' . ($item->total_profit ) . '</td>
                        </tr>';
        }
        return $tableRows;
    }

